import styled from 'styled-components';

export const Container = styled.div`
    width: 100%;
    height: 70px;
    background: #20295F;
    display: flex;
`;

export const LeftSide = styled.div`
    width: 50%;
    height: 70px;
    background: red;

`;

export const RightSide = styled.div`
    width: 50%;
    height: 70px;
    background: blue;
`;
